import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div class="mockup-code container w-[400px] m-auto mt-10">
      <pre data-prefix="$">
        <code>Echo hello world</code>
      </pre>
      <pre data-prefix=">" class="text-warning">
        <code>mkdir newfile</code>
      </pre>
      <pre data-prefix=">">
        <code>cd newfile</code>
      </pre>
    </div>
  );
}

export default App;
